import React from 'react';

class eventbind extends React.Component{
    constructor(props) {
        super(props);
        this.state={
            message:"Welcome"
        }
    }
    render(){
        return(
            <div>
                <div>{this.state.message}</div>
                <button>Click Me</button>
            </div>
        );
    }
}
export default eventbind;
